import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './WeekView.css'; // Ensure this file exists for styling

const WeekView = ({ currentDate }) => {
  const [tasks, setTasks] = useState({
    Monday: [], Tuesday: [], Wednesday: [], Thursday: [], Friday: [], Saturday: [], Sunday: []
  });

  const [newTask, setNewTask] = useState({
    Monday: '', Tuesday: '', Wednesday: '', Thursday: '', Friday: '', Saturday: '', Sunday: ''
  });

  const daysOfWeek = ['Monday', 'Tuesday', 'Wednesday', 'Thursday', 'Friday', 'Saturday', 'Sunday'];

  const startOfWeek = new Date(currentDate);
  startOfWeek.setDate(startOfWeek.getDate() - startOfWeek.getDay() + 1); // Monday as the first day of the week

  const getDateForDay = (dayIndex) => {
    const date = new Date(startOfWeek);
    date.setDate(startOfWeek.getDate() + dayIndex);
    return date.getDate();
  };

  // New useEffect to fetch tasks for the current week from the backend
  useEffect(() => {
    const fetchTasks = async () => {
      try {
        const response = await axios.get(`/api/tasks/?date=${currentDate}`);
        const fetchedTasks = response.data;

        const updatedTasks = { Monday: [], Tuesday: [], Wednesday: [], Thursday: [], Friday: [], Saturday: [], Sunday: [] };

        fetchedTasks.forEach(task => {
          updatedTasks[task.day_of_week].push(task);
        });

        setTasks(updatedTasks);
      } catch (error) {
        console.error('Error fetching tasks:', error);
      }
    };

    fetchTasks();
  }, [currentDate]);

  const handleAddTask = async (day, taskDescription) => {
    if (taskDescription) {
      const newTaskObj = { description: taskDescription, completed: false, date: currentDate, day_of_week: day };

      try {
        const response = await axios.post('/api/tasks/', newTaskObj);
        setTasks(prevTasks => ({
          ...prevTasks,
          [day]: [...prevTasks[day], response.data]
        }));
        setNewTask({ ...newTask, [day]: '' }); // Clear the input field
      } catch (error) {
        console.error('Error adding task:', error);
      }
    }
  };

  const handleToggleTask = async (day, index) => {
    const task = tasks[day][index];
    const updatedTask = { ...task, completed: !task.completed };

    try {
      const response = await axios.put(`/api/tasks/${task.id}/`, updatedTask);
      const newTasks = tasks[day].map((t, i) => i === index ? response.data : t);
      setTasks({ ...tasks, [day]: newTasks });
    } catch (error) {
      console.error('Error updating task:', error);
    }
  };

  const handleInputChange = (day, event) => {
    setNewTask({ ...newTask, [day]: event.target.value });
  };

  const handleInputKeyPress = (day, event) => {
    if (event.key === 'Enter') {
      handleAddTask(day, newTask[day]);
    }
  };

  return (
    <div className="week-view">
      <table className="week-table">
        <thead>
          <tr>
            <th></th> {/* Empty header for day initials and date */}
            <th></th>
          </tr>
        </thead>
        <tbody>
          {daysOfWeek.map((day, index) => (
            <tr key={day}>
              <td className="day-column">
                {day.charAt(0)} {/* Display first letter of the day */}
                <br />
                {getDateForDay(index)} {/* Display the correct date for the day */}
              </td>
              <td>
                <ul>
                  {tasks[day].map((task, taskIndex) => (
                    <li key={taskIndex} className={task.completed ? 'completed-task' : ''} onClick={() => handleToggleTask(day, taskIndex)}>
                      {task.description} {/* Use task.description instead of task.task */}
                    </li>
                  ))}
                </ul>
                <input
                  type="text"
                  value={newTask[day]}
                  onChange={(event) => handleInputChange(day, event)}
                  onKeyPress={(event) => handleInputKeyPress(day, event)}
                  placeholder="New Task"
                />
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default WeekView;
